import './App.css';
import React, { Component } from 'react';
import Ingredient from './pages/ingredientPage';
import HomePage from './pages/homePage';
import FreezeBee from './pages/freezebeePage';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Fabrication from './pages/fabricationPage';
import { Navbar, NavbarBrand, Container, Image, Nav } from 'react-bootstrap';
import Logo from './assets/logo.png';
import NavbarToggle from 'react-bootstrap/esm/NavbarToggle';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';

class App extends Component {
  render() {
    return (
        <Router>
          <Navbar collapseOnSelect expand="lg" bg="light" variant="dark">
            <Container>
              <Image src={Logo} alt="KillerBee" height="35"/>
              <Navbar.Brand className="mx-3" to={'/'}>KillerBee</Navbar.Brand>
              <Navbar.Toggle aria-controls="responsive-navbar-nav" />
              <Navbar.Collapse className="justify-content-md-end" id="responsive-navbar-nav">
                <Nav>
                  <Nav.Link to={"/freezebee"}>Freezebee</Nav.Link>
                  <Nav.Link to={"/fabrication"}>Fabrication</Nav.Link>
                  <Nav.Link to={"/ingredient"}>Ingrédients</Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Container>
          </Navbar>
          {/* <Navbar fixed="top" bg="dark" variant="dark">
            <Container className="navbar-all">
              <div className="navbar-left-part">
                <Image src={Logo} alt="KillerBee" height="40"/>
                <NavbarBrand as={Link} to={'/'} className="nav-brand mx-5">KillerBee</NavbarBrand>
              </div>
              <div className="navbar-right-part">
              <NavbarBrand as={Link} to={'/freezebee'} className="nav-link">
                FreezeBee
              </NavbarBrand>
              <NavbarBrand as={Link} to={'/fabrication'} className="nav-link">
                Procédé de fabrication
              </NavbarBrand>
              <NavbarBrand as={Link} to={'/ingredient'} className="nav-link">
                Ingrédient
              </NavbarBrand>
              </div>
            </Container>
          </Navbar> */}
            <Switch>
              <Route exact path='/' component={HomePage} />
              <Route path='/ingredient' component={Ingredient} />
              <Route path='/freezebee' component={FreezeBee} />
              <Route path='/fabrication' component={Fabrication} />
            </Switch>
        </Router>
    );
  }
}

export default App;
